import React, { Component, useState } from 'react';
import Carousel from 'react-bootstrap/Carousel';

 


function Home() {


	return (
		<div id="bd" className="body-wrapper">
			<div className="intro-wrapper">
				<div id="intro-text-one" className="intro-text-small">Hey there</div>
				<div id="intro-text-two" className="intro-text-large">I'm Darrin</div>
				<div id="intro-text-three" className="intro-text-small">(This intro is just temporary)</div>
			</div>
		</div>
			  )
			}
		
export default Home;
